import React from "react";
import { Container, Col } from "react-bootstrap";
import Product from "./Product";

function ProductBox() {
  return (
    <Container className="my-4 d-flex flex-row">
      <Col md={1} lg={1} xl={1}></Col>
      <Col xs={6} sm={6} md={3} lg={1} xl={1}>
        <Product />
      </Col>
      <Col xs={6} sm={6} md={3} lg={1} xl={1}>
        <Product />
      </Col>
      <Col xs={6} sm={6} md={3} lg={1} xl={1}>
        <Product />
      </Col>
      <Col xs={6} sm={6} md={3} lg={1} xl={1}>
        <Product />
      </Col>
      <Col md={2} lg={1} xl={1}></Col>
    </Container>
  );
}

export default ProductBox;
